import React from 'react';

class Portfolio extends React.Component {
    
    /**useEffect(() => {
        // Update the document title using the browser API
        state.title = `You clicked ${count} times`;
    });*/
    constructor() {
        super();
        this.state = {title: "Welcome too my list of github projects"};
    }

    render() {
        return (
            <div className="container">
                <h4>Projects</h4>
                {this.state.title}
            </div>
        )
    }
    
    
}

export default Portfolio;
